import React from 'react'
import styles from '../../../styles/styles'

const Hero = () => {
  return (
    <div className={`relative min-h-[70vh] 800px:min-h[80vh] w-full bg-no-repeat ${styles.normalFlex}`}
    styles={{
        backgroundImage: "url()"
    }}
    >

    </div>
  )
}

export default Hero
